import React, { useState } from "react";
import Accordion from "@mui/material/Accordion";
import AccordionSummary from "@mui/material/AccordionSummary";
import AccordionDetails from "@mui/material/AccordionDetails";
import Typography from "@mui/material/Typography";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from '@mui/material/Paper';
import TableContainer from '@mui/material/TableContainer';
import { styled } from '@mui/material/styles';
import "../App.css"
import axios from "axios";
import ControlPointIcon from '@mui/icons-material/ControlPoint';
import AddCircleSharpIcon from '@material-ui/icons/AddCircleSharp';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: "#d09c9e",
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

const AccordionTable = (props) => {
  const { foodData, userData, setUserData, getTodayMeal } = props;

  const incrementFood = (food, mealType) => {
    console.log(food.food_id._id);
    axios
      .put(
        "http://localhost:8000/api/user/addtomeal/" +
          food.food_id._id +
          "/" +
          mealType,
        userData,
        { withCredentials: true }
      )
      .then((res) => {
        setUserData(res.data);
        getTodayMeal();
      })
      .catch((err) => {
        console.log(err.response.data);
      });
  };
  return (
    <>
      <Accordion style={{paddingLeft:"20px"}}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography>Breakfast</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
          <TableContainer sx={{ minWidth: 650 }} aria-label="simple table">
              <TableHead>
                <TableRow>
                  <StyledTableCell>Breakfast</StyledTableCell>
                  <StyledTableCell align="center">Calories</StyledTableCell>
                  <StyledTableCell align="center">Fat(g)</StyledTableCell>
                  <StyledTableCell align="center">Carbs(g)</StyledTableCell>
                  <StyledTableCell align="center">Protein(g)</StyledTableCell>
                  <StyledTableCell align="center">+</StyledTableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {foodData &&
                  foodData.breakfast &&
                  foodData.breakfast.map((food, index) => {
                    return (
                      <StyledTableRow key={"breakfast" + index}>
                        <StyledTableCell>
                          {food.food_id.name} x {food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          {(food.food_id.fat * 9 +
                            (food.food_id.carb + food.food_id.protein) * 4) *
                            food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          {food.food_id.fat * food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          {food.food_id.carb * food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          {food.food_id.protein * food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          <AddCircleSharpIcon className="plusButton" onClick={() => incrementFood(food, "breakfast")} />
                        </StyledTableCell>
                      </StyledTableRow>
                    );
                  })}
              </TableBody>
            </TableContainer>
          </Typography>
        </AccordionDetails>
      </Accordion>
      <Accordion style={{paddingLeft:"20px"}}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel2a-content"
          id="panel2a-header"
        >
          <Typography>Lunch</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            <TableContainer component={Paper} sx={{ minWidth: 650 }} aria-label="simple table">
              <TableHead>
                <TableRow>
                <StyledTableCell>Lunch</StyledTableCell>
                  <StyledTableCell align="center">Calories</StyledTableCell>
                  <StyledTableCell align="center">Fat(g)</StyledTableCell>
                  <StyledTableCell align="center">Carbs(g)</StyledTableCell>
                  <StyledTableCell align="center">Protein(g)</StyledTableCell>
                  <StyledTableCell align="center">+</StyledTableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {foodData &&
                  foodData.lunch &&
                  foodData.lunch.map((food, index) => {
                    return (
                      <StyledTableRow key={"lunch" + index}>
                        <StyledTableCell>
                          {food.food_id.name} x {food.quantity}
                        </StyledTableCell>
                        <StyledTableCell align="center">
                          {(food.food_id.fat * 9 +
